const input = "";

function isValid(s) { // "aaabbbccccdddeeefff"
   
    const counts = Object.values( //[3, 3, 4, 3, 3, 3]
        s
        .split('')
        .reduce((acc, curr, a) => {
            if (acc[curr] !== undefined) {
                acc[curr]++;
            } else {
                acc[curr] = 1;
            }
            return acc;
        }, {})
        );
    console.log(counts);
    const freqs = Object.entries(
        counts.reduce((acc, curr, a) => { //[[3, 4], [4, 1]]
            if (acc[curr] !== undefined) {
                acc[curr]++;
            } else {
                acc[curr] = 1;
            }
            return acc;
    }, {}));
    console.log(freqs);
    if (freqs.length > 2) return 'NO';
    else if (freqs.length === 0) return 'NO';
    else if (freqs.length === 1 && freqs[0][1] !== 1) return 'NO';
    else if (freqs.length === 2 && !(freqs[0][1] === 1 || freqs[1][1] === 1))
        return 'NO';
    else if (freqs.length === 2) {
        let singleFreq, otherFreq;
        if (freqs[0][1] === 1) {
            singleFreq = freqs[0][0];
            otherFreq = freqs[1][0];
        } else {
            singleFreq = freqs[1][0];
            otherFreq = freqs[0][0];
        }
        console.log(singleFreq, otherFreq);
        console.log(Math.abs(parseInt(singleFreq) - parseInt(otherFreq)));
        if (singleFreq === '1' || Math.abs(parseInt(singleFreq) - parseInt(otherFreq)) === 1)
            return 'YES';
        else
            return 'NO';
    } else
        return 'YES';

}

console.log(isValid(input));
